# -*- coding: utf-8 -*
from slackbot.bot import respond_to
from slackbot.bot import listen_to
from slackbot.bot import default_reply
import requests

from PIL import Image, ImageDraw, ImageFont
import io
import re
import base64
from xml.sax.saxutils import unescape

@listen_to('ぜんぜんわからない、(.*)')
def mention_func1(message, arg1):
    
    
    data = ""


    # 頭のいらない部分を取り除いた上で、バイト列にエンコード
    image_data_bytes = re.sub('^data:image/.+;base64,','',data).encode('utf-8')
    # バイト列をbase64としてデコード
    image_data = base64.b64decode(image_data_bytes)#返り値もバイト列
    # ファイルとして開き、pillowのImageインスタンスにする
    im2 = Image.open(io.BytesIO(image_data))


    FONT_SIZE = 40 
    LINE_HEIGHT = 400
    BASE_LINE_OFFSET = -2

    def draw_text_tate(image, font, coord, size, text):
        draw = ImageDraw.Draw(image)

        sx, sy = coord
        nx, ny = size
        ix, iy = 0, 0
        for c in text:
            if c == u"\n":
                ix += 1
                iy = 0
                continue

            if iy >= ny:
                ix += 1
                iy = 0
            if ix >= nx:
                # 表示が溢れた
                return False

            x = sx - ix * LINE_HEIGHT - FONT_SIZE
            y = sy + iy * FONT_SIZE

            char_width, char_height = font.getsize(c)
            x += (FONT_SIZE - char_width) / 2
            y += BASE_LINE_OFFSET

            draw.text((x, y), c, fill=(0,0,0), font=font)

            iy += 1

        return True

    im = Image.new("RGB",(1220,720), "white")
    im.paste(im2,(5,5))#画像に画像を重ねる。二つ目の引数は位置の指定。
#    fnt = ImageFont.truetype('/slackbot/plugins/851MkPOP_customed.ttf', 25)
#    fnt = ImageFont.truetype('./ipaexm.ttf', 40)
    fnt = ImageFont.truetype('/slackbot/plugins/aozora-custom-bold.ttf', 40)
    draw_text_tate(im, fnt, (236,270), (4,7),  unescape(arg1) )
    im.save("/tmp/zenzen.png")
    message.channel.upload_file(fname="/tmp/zenzen.png", fpath="/tmp/zenzen.png")

